import './header.scss';
import React from 'react';
import About from './about.js';
import { Routes, Route, Link } from 'react-router-dom';

function Header() {
    return (
        <>
            <div className="Header">
                <a>Название</a>
                <a href="/about">О нас</a>
            </div>
            <Routes>
                <Route path="/about" element={<About />} />
            </Routes>
        </>
    );
}

export default Header;
